import { Row, Col,Input,Button } from 'antd';


export class Home extends Component {
    onCreate =()=>{
        this.props.history.push('/create');
    }
    onPlay =()=>{
        this.props.history.push('/play');
    }
    render() {
        return (
<Row >
<Row type = "flex" justify="space-around" align="middle" style ={{margin:"100px"}}>
<Col span={6}>
<Button block type="primary" shape="shape" size={64}
style={{height:"200px"}}
    onClick={this.onCreate}
    >
          Create
        </Button>    
        </Col>
    <Col span={6}>
    <Button block shape="shape" style={{height:"200px",fontSize:"100px"}}
        onClick={this.onPlay}
>Play</Button>
    </Col>
</Row>
</Row>
        )
    }
}

export default Home
